import seaborn as sns
from faicons import icon_svg

# Import data from shared.py
from shared import app_dir, df

from shiny import reactive
from shiny.express import input, render, ui

ui.page_opts(title="Property dashboard", fillable=True)


with ui.sidebar(title="Filter controls"):
    ui.input_slider("Price", "Price", 2000, 18000000, 1800000, step=1000)
    ui.input_checkbox_group(
        "City",
        "City",
        ['Joshua Tree', 'Panorama Heights', 'Yucca Valley', 'Big Bear City',
       'Big Bear Lake'],
        selected=['Joshua Tree', 'Panorama Heights', 'Yucca Valley', 'Big Bear City',
       'Big Bear Lake'],
    )
    ui.input_checkbox_group(
        "dfsub",
        "Subset Dataframe",
        {"duplicates": "Duplicates", "missing": "Missing Values"},
    )


with ui.layout_column_wrap(fill=True):
    with ui.value_box(showcase=icon_svg("house")):
        "Number of Properties"

        @render.text
        def count():
            return filtered_df().shape[0]

    with ui.card():
        "Price"

        @render.text
        def price_mean():
                return f"mean ${filtered_df()['Price'].mean():.2f}"

        @render.text
        def price_median():
                return f"median ${filtered_df()['Price'].median():.2f}"


    with ui.value_box(showcase=icon_svg("dollar-sign")):
        "Mean Rent Estimate"

        @render.text
        def bill_depth():
            return f"${filtered_df()['Rent Estimate'].mean():.2f}"

    with ui.value_box(showcase=icon_svg("dollar-sign")):

        "Median Rent Estimate"

        @render.text
        def bill():
            return f"${filtered_df()['Rent Estimate'].median():.2f}"


with ui.layout_columns():
    with ui.card(full_screen=True):
        ui.card_header("Rental Estimate vs Price")

        @render.plot
        def length_depth():
            return sns.scatterplot(
                data=filtered_df(),
                x="Price",
                y="Rent Estimate",
                hue="City",
                style="City",
            )

    with ui.card(full_screen=True):
        ui.card_header("Property data")

        @render.data_frame
        def summary_statistics():
            cols = [
                "Price",
                "City",
                "Rent Estimate",
            ]
            return render.DataGrid(filtered_df()[cols], filters=True)

with ui.layout_columns():
    with ui.card(full_screen=True):
        ui.card_header("Rent Estimate by City")

        @render.plot
        def leng_depth():
            return sns.boxplot(
                data=filtered_df(),
                x="City",
                y="Rent Estimate",
                showmeans=True,
            meanprops={'marker':'x',
                       'markerfacecolor':'white', 
                       'markeredgecolor':'black',
                       'markersize':'8'},
            )


ui.include_css(app_dir / "styles.css")


@reactive.calc
def filtered_df():
    filt_df = df[df["City"].isin(input.City())]
    filt_df = filt_df.loc[filt_df["Price"] < input.Price()]
    if "duplicates" in input.dfsub():
        filt_df = filt_df[~filt_df.duplicated(['Living Area','Street Name','City','Zip'],keep=False)]
    if "missing" in input.dfsub():
        filt_df = filt_df.dropna()
    return filt_df
